INSERT INTO `csrresourcesdetails` (`CSRResourcesId`, `Title`, `Description`, `Image`, `CorporateId`, `Publishing_Date`, `Recorded_Date`) VALUES
(1, '2023 India CSR Outlook Report | 10 Years of CSR Compliance in India and Envisioning the Next 10 Years', 'About the Report\r\nThe India CSR Outlook Report (ICOR) 2023, is a flagship research publication, jointly presented by CSRBOX and NGOBOX. This report offers major insights on CSR spent by large companies in India while highlighting the dynamic evolution of the CSR landscape within the country.\r\nUnlike the earlier editions, ICOR 2023 is an outcome of primary and secondary research wherin we have captured inputs from major CSR decision-makers of a few large companies. Addtionallly, the report also captures major trends in CSR over the past 9 years within the country.', , 1, '2023-12-30', '2023-12-29');
INSERT INTO `csrresourcesdetails` (`CSRResourcesId`, `Title`, `Description`, `Image`, `CorporateId`, `Publishing_Date`, `Recorded_Date`) VALUES
(2, '2022 India CSR Outlook Report | CSR Analysis of Large 301 Listed Companies (FY 2021-22) | Full Version', 'About the Report\r\nThe India CSR Outlook Report (ICOR) is an annual research publication of CSRBOX and NGOBOX, which presents an in-depth analysis of the CSR spend of large companies in the last nancial year. The 2022 report is the 8th such annual publication in the annual series The report provides a comprehensive analysis of the CSR spend of 301 large companies in FY 2021-22 and visualizes a few important curves of the CSR landscape in India. The 301 companies, selected in this report, were short-listed based on the following criteria:\r\n\r\nINR 1 Cr. or above prescribed CSR in FY 2021-22\r\nListed on BSE and/or NSE or PSU\r\nAvailability of the CSR data by 15th September 2022 and disclosures as per Section 135 of the Companies Act\r\n', , 1, '2023-12-30', '2023-12-29');
INSERT INTO `csrresourcesdetails` (`CSRResourcesId`, `Title`, `Description`, `Image`, `CorporateId`, `Publishing_Date`, `Recorded_Date`) VALUES
(3, '301 Large Indian Corporate have spent over INR 12000 crore, more than their prescribed CSR limit in FY 20-21', 'The India CSR Outlook Report (ICOR), an annual research publication of CSRBOX presents an in-depth and comprehensive analysis of CSR spending of 301 large companies in the financial year 2020-21 and visualizes a few important curves and trends of the CSR landscape in India. The report covers:\r\n\r\nNumber of Companies (Listed): 301\r\nTop BSE 200 are covered in the research\r\nNumber of PSUs covered: 22\r\nNumber of Projects Implemented in FY 20-21: 6759\r\nTotal mandated Prescribed CSR Budget in FY 20-21: INR 11660 Cr.\r\nTotal Actual CSR Spent in FY 20-21: INR 12180 Cr.', , 1, '2023-12-30', '2023-12-29');
INSERT INTO `csrresourcesdetails` (`CSRResourcesId`, `Title`, `Description`, `Image`, `CorporateId`, `Publishing_Date`, `Recorded_Date`) VALUES
(4, 'Large 10 Rural Development CSR Projects in India for the Year 2020-21', 'India is a country of villages where about 65 per cent of the population are living in rural areas. These villages are underdeveloped. There are poverty, unemployment, hunger, illiteracy, ill health, inadequate infrastructure and high mortality in rural areas. CSR is the commitment of companies to contribute to sustainable development and improve the lives of the society. It has been recognized by policy makers and development specialists as a feasible driver for rural development. Rural development is closely linked to public welfare and development of the society. Thus, the activities undertaken by corporate for the welfare of the rural society and rural development benefit business and ensure its rural up gradation. Hence, it is the responsibility of the companies in their own interest to contribute their profit towards welfare of the society. Mapping out the same for the FY 2020-21, below are the top 10 Rural Development oriented projects through CSR in India based on the CSR funds allocation of each company.', , 1, '2023-12-30', '2023-12-29');

