INSERT INTO `faqdetails` (`FAQId`, `Question`, `Answer`, `QuestionType`, `Category`, `CorporateId`, `Publishing_Date`, `Recorded_Date`) VALUES
(1, 'Q. What is CSRBOX ?', 'A. CSRBOX (www.csrbox.org) is India''s largest CSR impact-intelligence and partnerships platform. It lists CSR portfolio of 1000+ companies falling under the ambit of mandatory CSR and investing altogether more than INR 10,000 Cr. on CSR projects each year. The platform takes the engagement with organizations a step higher, where not-for-profits and social enterprises are provided support and outreach services to help them connect with businesses that are looking for good CSR implementation partners.', 'General FAQs on CSRBOX', 'Corporate', 1, '2023-12-30', '2023-12-29'),
(2, 'Q. How is CSRBOX platform useful?', 'A. For Donor agencies/ Corporate: CSRBOX provides a host of services for catalysing CSR partnerships. On using the Corporate Login, CSRBOX platform provides a customized Dashboard for Corporate users through which one can identify validated non-profit partners, review CSR profiles of companies & organizations, and shortlist projects, proposals and innovative products. One can also access CSR reports and success stories, and learn about the latest trends and news in the CSR ecosystem. User can also directly contact an Organization by showing interest.', 'General FAQs on CSRBOX', 'Corporate', 1, '2023-12-30', '2023-12-29'),
(3, 'Q. Does CSRBOX release research reports on CSR?', 'A. CSRBOX releases various reports defining the CSR landscape in India, entirely based on the actual CSR spending data of various companies. CSRBOX also provides knowledge resources in the form of Thematic and Geographic CSR Reports, CSR decision-making tools and Sectoral insights.', 'General FAQs on CSRBOX', 'Corporate', 1, '2023-12-30', '2023-12-29'),
(4, 'Q. What is CSRBOX dashboard?', 'A. CSRBOX’s dashboard is a one-stop platform for corporate and implementing agencies for interaction and establishes symbiotic relationship among respective stakeholders. It offers exclusive access to the detailed proposals of different projects in various thematic areas submitted by the implementing organizations. You can shortlist, rate, review and show interest to the proposals. Further, you may collaborate with organizations in your preferred domain through a transparent process.', 'CSRBOX Dashboard', 'Corporate', 1, '2023-12-30', '2023-12-29'),
(5, 'Q. How is CSRBOX platform useful?', 'A. For Implementing Agencies: CSRBOX provides a host of services for catalysing CSR partnerships. CSRBOX helps implementing agencies (non-profits and social enterprises) by supporting strategic outreach to companies. On using the Organization Login, implementing agencies can access the CSRBOX Dashboard through which user can browse through and organize profiles of interesting companies, organizations, projects and products. CSRBOX platform also provides resources to help you understand CSR portfolio of companies, geographic and thematic mapping, CSR reports and data tools. You can also view impact stories, talks, CSR reports, News articles etc. to stay updates with the latest trends.\r\nFor Social Enterprises: CSRBOX hosts a section for innovative products. Social Enterprises that produce and distribute such innovative products to be used in CSR projects, can use the Organization login to access the dashboard. User can register their product to avail benefits of the platform.', 'General FAQs on CSRBOX', 'NGO', 1, '2023-12-30', '2023-12-29'),
(6, 'Q. How CSRBOX acts a CSR search engine?', 'A. CSRBOX acts as a directory of CSR projects, company’s profiles, social businesses, CSR implementing agencies and service providers in India. It helps in understanding theme and geography-wise CSR projects distribution, spend and partnership models. It’s a CSR search engine for companies to find vetted CSR partners, field work agencies and various products suppliers.', 'General FAQs on CSRBOX', 'NGO', 1, '2023-12-30', '2023-12-29'),
(7, 'Q. What are the eligibility criteria for an NGO?', 'A. For an NGO, it should fulfil the below eligibility conditions:\r\n\r\nAt least 3 years of track record of on-field work\r\nAt least 3 full time professional staff\r\nLast three years of annual audited report\r\nPre-defined thematic focus and expertise\r\n80 G and 12 A (must)\r\nFCRA (Optional)', 'For Implementing Organizations', 'NGO', 1, '2023-12-30', '2023-12-29'),
(8, 'Q. Which category should I select in the Organization type?', 'A. If you want to register your product, select Product Supplier. If you are representing an NGO or Implementing organization etc, select the relevant option.', 'For Implementing Organizations', 'NGO', 1, '2023-12-30', '2023-12-29');

