INSERT INTO `ngodetails` (`NGOId`, `Name`, `EstablishedIn`, `RegistrationNo`, `Description`, `Image`, `Address`, `CorporateId`, `Publishing_Date`, `Recorded_Date`) VALUES
(1, 'Vegan Outreach', '1993', '', 'Vegan Outreach stands out as a trailblazing force committed to transforming lives, fostering compassion, and advocating for a more sustainable world. We take pride in our:\r\n\r\nTransformative Initiatives: Our flagship programs, such as the 10 Weeks to Vegan challenge and Green Tuesday Initiative, are at the forefront of change. Through step-by-step guidance and strategic partnerships, we''re reshaping perceptions and building a future where all beings live harmoniously with nature.\r\n\r\nGlobal Outreach: With Green Tuesday Initiative launching in Vietnam, we are furthering our mission to fight climate change with diet change. Our reach extends beyond borders, uniting diverse communities under a common goal of compassion for the animals and the planet.\r\n\r\nSustainable Impact: The Green Tuesday Initiative catalyzes sustainable transformation. By partnering with institutions, we''re making tangible progress in reducing animal product consumption and promoting ethical food choices for the environment and health.', , '401, Raghavendra Towers , Patwari Enclave, IDPL , Hyderabad , Telangana , 500037', 1, '2023-12-30', '2023-12-29'),
(2, 'I-India', '1993', 'CSR00018589', 'Established in 1993, I-India is a fully registered non-profit organization located in the capital city of Jaipur, Rajasthan. With a dedicated commitment to advancing child rights and assisting the most vulnerable individuals for over three decades, we have positively impacted the lives of over a million children and their families through our comprehensive and diverse interventions expanded in streets, slums and  rural areas of Jaipur. \r\n\r\nCurrently, we engage with more than 10000  children and families annually through our schools for street children, medical units, residential homes, and vocational training centers etc. \r\nOur  organization focuses on providing support to children and communities facing immediate challenges such as homelessness, child labor, poverty, trafficking, malnutrition, illness, access to safe water, hygiene and sanitation. In addition to addressing these pressing issues, we also work on nurturing their attitudes and skills, equipping them with better opportunities and the ability to shape their own futures.\r\nOur overarching goal is to create a positive, lasting and sustainable impact on the lives of those we serve. We are committed to empowering children by protecting their rights, mainstreaming, linking them to NGO run formal education, providing healthcare, nutrition, vocational training, counsellinf services, access to employement opportunities and mentoring and long term emotional support. \r\nMore than an NGO, we are a strong and passionate family, united in the belief that every child deserves his/her fundamental rights and equal opportunities to develop and live upto the best potential.', , '23, Mahatma Gandhi Nagar, DCM, Ajmer Road jaipur , Rajasthan , 302021', 1, '2023-12-30', '2023-12-29');
INSERT INTO `ngodetails` (`NGOId`, `Name`, `EstablishedIn`, `RegistrationNo`, `Description`, `Image`, `Address`, `CorporateId`, `Publishing_Date`, `Recorded_Date`) VALUES
(3, 'Banka Earth Foundation', '2020', 'CSR00015909', 'Banka Earth Foundation, a non-profit organization registered under Section 8 of the Companies Act, 2013, operates in the State of Telangana, India. Our commitment spans a diverse spectrum of social and environmental causes, all directed towards enhancing the quality of life for underprivileged communities and fostering sustainable development. Our focus is on creating a cleaner, better India through Water, Sanitation, and Hygiene (WaSH) tech projects, aiming to improve sanitation practices and water hygiene for all.', , 'Plot No. 11-4-651, A-109 , Express Apartments, Lakdi ka Pool , Hyderabad , Telangana , 500004', 1, '2023-12-30', '2023-12-29');

